import React, { Component } from "react";

export class home extends Component {
  render() {
    return (
      <div>
        <style>{"body { background-color: #9EC8FF; }"}</style>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "10rem",
            fontSize: 32,
          }}
        >
          Welcome to ReFinance
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 23,
          }}
        >
          A new way to finance
        </div>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginTop: "3rem",
            fontSize: 10,
          }}
        >
          <button type="button" class="btn btn-link">
            Login!
          </button>
          <button
            type="button"
            class="btn btn-link"
            style={{
              marginLeft: "1rem",
            }}
          >
            Sign Up!
          </button>
        </div>
      </div>
    );
  }
}

export default home;
